mongocxx: Inserting a Datetime<p>I'm trying to insert a date and time into mongocxx after parsing a data file, my actual datetime is:</p>

<pre><code>2007/12/01 00:00:00
</code></pre>

<p>That is, December 1, 2007 at midnight. I have this code:</p>

<pre><code>static bsoncxx::document::value make_doc(sm_struct const sm) {
    std::tm t{0};
    t.tm_sec = 0;
    t.tm_min=(int)sm.minute;
    t.tm_hour=(int)sm.hour;
    t.tm_mday=(int)sm.day-1;
    t.tm_mon=(int)sm.month;
    t.tm_year=sm.year-1900;
    t.tm_isdst = -1;
    std::time_t tt = mktime(&amp;t);

    std::cout &lt;&lt; sm.year &lt;&lt; " " &lt;&lt; t.tm_year &lt;&lt; "/" &lt;&lt; t.tm_mon &lt;&lt; "/" &lt;&lt; t.tm_mday &lt;&lt; " " &lt;&lt; t.tm_hour &lt;&lt; ":" &lt;&lt; t.tm_min &lt;&lt; std::endl;
    bsoncxx::document::value document = bsoncxx::builder::basic::make_document(
        bsoncxx::builder::basic::kvp("datetime", bsoncxx::types::b_date{
            std::chrono::system_clock::from_time_t(tt)
        }),
    );
    return document;
}
</code></pre>

<p>Running my code I get this on stdout:</p>

<pre><code>2007 107/11/31 0:0
</code></pre>

<p>When I check my date in the database I get:</p>

<pre><code>ISODate("2007-12-30T13:30:00.000+0000")
</code></pre>

<p>How come the hours and minutes are not being set correctly here?</p>

