MongoClient throw MongoError: server instance pool was destroyed<p>I saw these posts on SO describing this error. Most of them was by the reason that JavaScript is async and mongoClient.close() called outside of callback. That's not my case, but I don't know what else can be the reason.</p>

<pre><code>const MongoClient = require('mongodb').MongoClient;
const url = "mongodb://localhost:27017/";
const mongoClient = new MongoClient(url, {
    useNewUrlParser: true
});

module.exports = class Mongo {
    insertOne(article) {
        mongoClient.connect((err, client) =&gt; {
            const db = client.db('grabber');
            db.collection("zr").insertOne(article, (err, res) =&gt; {
                if (err) throw err;
                mongoClient.close();
            });
        });
    };
}
</code></pre>

