How to Loop Data and Validate in Mongodb<p>I have a dynamic input field where user can add multiple category at once. Data sent at backend is like</p>

<p><code>['ELECTRONIC','TOYS','GAMES']</code></p>

<p>Now I want to check for each element of the array ,if they are already present on mongodb . If its present i want to store it in <code>errors</code> object as</p>

<p><code>errors={ 0: 'Duplicate Data found'}</code></p>

<p>I am attaching my code for validation which is not working please help . . </p>

<p><div class="snippet" data-lang="js" data-hide="false" data-console="true" data-babel="false">
<div class="snippet-code">
<pre class="snippet-code-js lang-js prettyprint-override"><code>const Category = require('../../models/Category');


const fieldCheck = (req, res, next) =&gt; {
    const data = req.body;
    const errors = [];
    for( i = 0; i &lt; data.length ; i++){
    Category.findOne({ category_name : data[i]})
    .then(user =&gt; {
        if(user){
            // # If a reqistered User ID is found ,then move ahead
            errors[i] = 'Duplicate Entry Found';
            errors.push(errors[i]);
        } 
    }).catch(err =&gt;{
        return res.json(err);
        }
    )
    }
    console.log(errors);
};

module.exports = fieldCheck;</code></pre>
</div>
</div>
</p>

<p>My Category Schema is ....</p>

<p><div class="snippet" data-lang="js" data-hide="false" data-console="true" data-babel="false">
<div class="snippet-code">
<pre class="snippet-code-js lang-js prettyprint-override"><code>const mongoose = require('mongoose');
const Schema = mongoose.Schema;

const categorySchema = new Schema ({
    category_name:{
        type:String,
        unique:true,
        isRequired:true,
        
    },
    date:{
        type:Date,
        default:Date.now()
    }
