Concurrency problem during upsert in MongoDB<p>I'd like to insert or update a document in MongoDB based on if a document with that id already exists.</p>

<p><strong>My object</strong></p>

<pre><code>long _Id                 // Generated by myself (requirement)
List&lt;Products&gt; Products
</code></pre>

<p><strong>Desired insert behaviour</strong></p>

<p>Check if a shop object with id X exists. If not? Insert object with given id and a new products list.</p>

<p><strong>Desired update behaviour</strong></p>

<p>Check if a shop object with id X exists? If yes? Update object by pushing a new item to the array.</p>

<p><strong>Code</strong></p>

<p>I'm using C# with the Mongo Driver Nuget package. And I've come up with the following code:</p>

<pre><code>public async Task&lt;MongoCmdResult&gt; CreateOrUpdate(ShopDocument shopDocument)
{
    var filterLibrary    = Builders&lt;ShopDocument&gt;.Filter;
    var filter           = filterLibrary.Eq(shop =&gt; shop._Id, shopDocument._Id)
            &amp; filterLibrary.ElemMatch(shop =&gt; shop.Products, products =&gt; products.ProductId != shopDocument.Products[0].ProductId);
    var updateDefinition = Builders&lt;ShopDocument&gt;.Update.Push&lt;ShopDocument.Products&gt;(shop =&gt; shop.Products, shopDocument.Products[0]);
    var updateOptions    = new FindOneAndUpdateOptions&lt;ShopDocument&gt; { IsUpsert = true };
    return await collection.FindOneAndUpdateAsync(filter, updateDefinition, updateOptions);
}
</code></pre>

<p><strong>Problem</strong></p>

<p>Although this code at first seemed to do the job perfectly, it started throwing some exceptions when called parallel multiple times: <code>Command findAndModify failed: Non-unique id.</code>.</p>

<p>My theory to why this (sometimes) fails when executed in parallel (in this example 2 parallel calls) is that during the collection read in both calls (applying the filter) there appears to be no document with the given id. MongoDB decides both queries should insert. The first one succeeds, the second one fails on <code>Non-unique id</code> cause the other query was faster and the to be inserted document already exists (based on id).</p>

<p>In this scenario, is there no other (read: better) way than to try catch the <code>FindOneAndUpdateAsync</code> method and retry once in case of a duplicate key error? Is there for example something that I could change in my update options or filter to account for this problem?</p>

