Find comparing two DateTime field on Mongo<p>I'm trying to compare two field of the same document but I need add some seconds to one of them. </p>

<p>My query is:</p>

<pre><code>db.getCollection('period').find({
    $where: function() {
        return this.dt_stop &lt;= this.dt_start.getTime() + 60000 
    } 
})
</code></pre>

<p>But I get the next error:</p>

<pre><code>Error: error: {
    "ok" : 0,
    "errmsg" : "TypeError: this.dt_last_start is undefined :\n@:1:15\n",
    "code" : 139,
    "codeName" : "JSInterpreterFailure"
}
</code></pre>

<p>I don't get to add second to field. Any idea?</p>

<p><strong>---SOLVE--</strong>
The problem was some documents whose this.dt_stop didn't exists. The final code: </p>

<pre><code>db.getCollection('period').find(
{
    "$and" : [ 
        {"dt_stop" : {"$exists" : true}},
        {"dt_start" : {"$exists" : true}}, 
        { $where: function() {return this.dt_end.getTime() &lt;= this.dt_begin.getTime()+60000} 
        } 
    ]
}) 
</code></pre>

